@VipinSharmaSir So the reason why all indians are behaving :"Andhbagats" is because they take the reel as the primary source of knowledge and the fact checking is not in their dictionary. please give a read what the "GOC" means in military terminology:
In military and Air Force terminology, **Center of Gravity (COG)** refers to the primary source of strength, balance, or stability that enables a force to sustain combat operations. It can be physical, moral, or both, and exists at all tactical, strategic, and operational levels of war simultaneously. The concept was originally developed by **Carl von Clausewitz**, a Prussian military theorist, in his work *On War*.

The **United States Department of Defense** defines a COG as "the source of power that provides moral or physical strength, freedom of action, or will to act". It plays a crucial role in military planning, as disrupting an adversary's COG can significantly weaken their ability to fight.

